            <div className="coin d-flex">
                <div className="col">
                <p>ETHERIUM <span className="badge badge-primary">ETH</span></p>
                <p>0.09544501 <span>BTC</span></p>
                <p>12000$</p>
                </div>
                <div className="col">
                    <p>21.51%</p>
                    <img src="..\src\img\eth-logo.png" alt="ss"/>
                </div>
            </div>
        )
    }
}
export default Coins;
